  var js = "/**\nTemplate name: Banner\nURI: https://cookieinformation.com\nVersion 1.0.1\n**/\n\nvar coiConsentBanner = document.getElementById('coiConsentBanner');\nvar renewBtn = document.getElementById('Coi-Renew');\nvar purposesList = document.getElementsByClassName('coi-purpose-list');\n\nfunction insertPurposesInList(){\n  if(purposesList){\n    for (var i = 0; i < purposesList.length; i++) {\n      var purposesElements = document.getElementById('coi-banner-categories').innerHTML;\n      purposesList[i].innerHTML = purposesElements;\n    }\n  }\n}\n\nfunction toggleDetails(id) {\n    var coiConsentBannerBase = document.getElementById('coiConsentBannerBase');\n    var coiShowDetails = document.getElementById('coiShowDetails');\n    var coiHideDetails = document.getElementById('coiHideDetails');\n    var coiConsentBannerBottom = document.getElementById('coiConsentBannerBottom');\n    var isMobile = window.matchMedia('(max-width: 760px)').matches;\n\n    if (id === 'coiShowDetails') {\n      coiConsentBannerBottom.style.maxHeight = coiConsentBannerBottom.scrollHeight\n        + coiConsentBannerBase.scrollHeight + \"px\";\n      coiConsentBanner.style.overflowY = 'auto';\n      coiShowDetails.style.display = 'none';\n      coiHideDetails.style.display = 'block';\n\n      if (!isMobile) {\n        document.getElementById('coi-consent-banner__category-expander-cookie_cat_necessary').checked = true;\n      }\n    }\n    else {\n      coiConsentBannerBottom.style.maxHeight = '0';\n      coiConsentBanner.style.overflowY = 'hidden';\n      coiConsentBanner.scrollTop = '0';\n      coiShowDetails.style.display = 'block';\n      coiHideDetails.style.display = 'none';\n    }\n  }\n\n  function toggleIndicator(element) {\n    if (element.id === 'coiDeclarationIndicator') {\n      document.getElementById('coiConsentBannerAboutOwnerColumn').style.display = 'none';\n      document.getElementById('coiConsentBannerCategoriesWrapper').style.display = 'block';\n      document.getElementById('coi-consent-banner__bottom-bar').style.display = 'flex';\n\n      document.getElementById('coiDeclarationIndicator').classList.add(\"active\");\n      document.getElementById('coiAboutIndicator').classList.remove('active');\n    }\n    else if (element.id === 'coiAboutIndicator') {\n      document.getElementById('coiConsentBannerAboutOwnerColumn').style.display = 'flex';\n      document.getElementById('coiConsentBannerCategoriesWrapper').style.display = 'none';\n      document.getElementById('coi-consent-banner__bottom-bar').style.display = 'none';\n\n      document.getElementById('coiAboutIndicator').classList.add(\"active\");\n      document.getElementById('coiDeclarationIndicator').classList.remove('active');\n    }\n  }\n\n  function showDescription(event, id) {\n    var isMobile = window.matchMedia('(max-width: 760px)').matches;\n    var categoryCheckbox = document.getElementById(id);\n\n    if (isMobile) {\n      categoryCheckbox.checked = !categoryCheckbox.checked;\n      event.preventDefault();\n    }\n  }\n\nfunction togglePlaceholderElementsOnConsent(){\n    var consentplaceholders = document.getElementsByClassName('consent-placeholder');\n    if(consentplaceholders){\n        for(var i = 0; i < consentplaceholders.length; i++){\n            if(!CookieInformation.getConsentGivenFor(consentplaceholders[i].getAttribute('data-category'))){\n                consentplaceholders[i].style.display = 'block';\n            }else{\n                consentplaceholders[i].style.display = 'none';\n            }\n        }\n    }\n}\n\nfunction showCookieBanner() {\n  insertPurposesInList();\n  coiConsentBanner.style.display = 'block';\n  coiConsentBanner.setAttribute('aria-hidden','false');\n  coiConsentBanner.focus();\n  renewBtn.style.display = 'none';\n  togglePlaceholderElementsOnConsent();\n}\n\nfunction hideCookieBanner() {\n  coiConsentBanner.style.display = 'none';\n  coiConsentBanner.setAttribute('aria-hidden','true');\n  renewBtn.style.display = 'block';\n  togglePlaceholderElementsOnConsent();\n}";
